details:
GDIT is seeking an Epidemiologist to use SAS programing expertise to analyze large health datasets for epidemiological studies and reports.Our client, the Armed Forces Health Surveillance Branch (AFHSB), strives to be the central epidemiological resource and a global health surveillance proponent for the U.S. Armed Forces. The AFHSB provides timely, relevant, actionable, and comprehensive health surveillance information in order to promote, maintain, and enhance the health of military and military- associated populations. Responsibilities:
Supports the Senior Analysts and Senior Managing Epidemiologists in accomplishing their tasks and objectives;
Assists in quality assurance verification of programming codes contained in current and past reports;
Analyzes, interprets, and summarizes morbidity and mortality surveillance data;
Demonstrates proficiency in SAS in manipulating very large (1,000,000+ records) datasets and conducting routine surveillance;
Conducts statistical analyses to include Poisson and logistic regression and survival analysis;
Runs routine recurring weekly, monthly, annual reports on surveillance statistics and reviews results for accuracy and validity
Performs research, analysis, development and evaluation of systems, procedures and models in assigned functional area.



This position requires significant SAS coding experience and expertise and is largely analytic in nature. 
5-8 years of related experience in scientific research and analysis.
At least 3 years experience with Base SAS programming required.
Experience with large datasets and/or military databases is preferred.
Prior experience with the Department of Defense or military populations preferred.
Must be able to obtain a secret level clearance Applicants selected will be subject to a U.S. Government security investigation and must meet eligibility requirements for access to classified information. Secret clearance is highly preferred.

 As a trusted systems integrator for more than 50 years, General Dynamics Information Technology provides information technology (IT), systems engineering, professional services and simulation and training to customers in the defense, federal civilian government, health, homeland security, intelligence, state and local government and commercial sectors.With approximately 32,000 professionals worldwide, the company delivers IT enterprise solutions, manages large-scale, mission-critical IT programs and provides mission support services.GDIT is an Equal Opportunity/Affirmative Action employer. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, sexual orientation, gender identity, national origin, disability, or veteran status, or any other protected class.#CB#DICE#HCSDCJ#HS

***Only applicants with a Top Secret (TS) Clearance need apply*** General Dynamics Information Technology (GDIT), a leading provider of systems engineering, integration, IT service operations and support solutions, is seeking talented professionals to deliver valuable services and solutions to our customers.GDIT has a great team consisting of experienced and knowledgeable managers who lead and support the career development objectives of our employees. Our employees consider the company to be a solid partner in their career, with an abundance of opportunities for advancement.We are seeking a Subject Matter Specialist (SAS) to support our Justice Programs team in Washington, DC. In this position, you will support the FBI’s Insider Threat CenterPersonnel supporting this task: 
Serve as the Subject Matter Expert for SAS in a Big Data environment 
Develop recommendations to optimize program performance in terms of quality, access and cost. 
Provide SAS programming support to develop analytic products 
Perform risk modeling 
Design and maintain a SAS analytic solution on an Apache Hadoop infrastructure 
Develop experiment designs and campaign and operational processes to enable adequate data capture and optimization points 
Provide mentoring, training and support to other analysts. 
Translates user-defined capabilities into system/product requirements; 
Resolves complex issues as they arise; 
Provides subject matter expertise in assigned projects through all phases of the development lifecycle; 



(Preferred) Master’s degree in Computer Science, Math, Finance or business related field or equivalent experience; 
At least five (5+) years of prior experience in data mining, statistical analysis and modeling. ; 
At least five (5+) years of experience with SAS Software; 
Solid knowledge of assessing requests and then designing and developing analysis, data or reports; 
Strong problem solving skills and capability to understand and set direction for complex technology integration; 
Demonstrable experience with Linux, Unix, Windows; Java or Shell scripting; SQL; 
Multiple Information Technology certifications in provisioning technologies such as SAS Certified Statistical Business Analyst Using SAS 9, Regression Modeling, SAS Certified Visual Business Analyst, Exploration and Design Using SAS Visual Analyst, Exploration and Design Using SAS Visual Analytics; 
